        $(".loading").css("z-index", -1);
    }
  });

  let pass = document.getElementById('pass');

  if (!pass) {
    // If the variable is undefined, assign it
    pass = document.getElementById('pass');
  }

  const inputHandler = function(e) {
    $(".wrong-pass").hide();
    if(e.target.value == '')
